import React, { useContext } from 'react';
import { GraphContext } from '../contexts/GraphContext';

const PathfindingToggle = () => {
  const { isPathfindingEnabled, togglePathfinding } = useContext(GraphContext);

  console.log('PathfindingToggle render, isPathfindingEnabled:', isPathfindingEnabled);

  return (
    <div className="pathfinding-toggle">
      <label>
        <input
          type="checkbox"
          checked={isPathfindingEnabled}
          onChange={() => {
            console.log('PathfindingToggle onChange');
            togglePathfinding();
          }}
        />
        Enable Pathfinding
      </label>
    </div>
  );
};

export default PathfindingToggle;
